import React, { Component } from 'react';
import './App.css';
import { Input, Button } from 'antd';

class Login extends Component {
	constructor(props) {
		super(props);
		this.state = {
			first_name: '',
			last_name: '',
			email: '',
			password: ''
		};
	}

	render() {
		return (
			<div className="Login-page">
				{/* SIGN-IN */}
				<div className="Sign">
					<Input
						className="Login-input"
						placeholder="arthur@lacapsule.com"
						onChange={(e) => this.setState((state) => ({ email: e }))}
						value={this.state.email}
					/>
					<Input.Password
						className="Login-input"
						placeholder="password"
						onChange={(e) => this.setState((state) => ({ password: e }))}
						value={this.state.password}
					/>
					<Button href="" style={{ width: '80px' }} type="primary">
						Sign-in
					</Button>
				</div>

				{/* SIGN-UP */}
				<div className="Sign">
					<Input className="Login-input" placeholder="Arthur G" />
					<Input.Password className="Login-input" placeholder="password" />
					<Button href="" style={{ width: '80px' }} type="primary">
						Sign-up
					</Button>
				</div>
			</div>
		);
	}
}

export default Login;
